import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    const logoutRequest = async () => {
        try {
            await axios.get("http://localhost:1234/logout");
            window.sessionStorage.clear();
            history.push("/login");
        }
        catch (e) {
            alert(e);
        }
    }
    return (
        <div className="header">
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <h3 className="navbar-brand">RacerIn</h3>
                    {/* <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                    </button> */}
                    <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <Link to="/main" className="nav-link" href="#">메인</Link>
                        </li>
                        <li className="nav-item">
                            <Link to="/network" className="nav-link" href="#">네트워크</Link>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" onClick={logoutRequest}>로그아웃</a>
                        </li>
                    </ul>
                    </div>
                </div>
            </nav>
        </div>
    )

}

export default Header
